Artificial Intelligence (AI) algorithm to filter out relevant items connected to the subjects of youth mobility and learning programmes, such as Erasmus. All content is automatically translated to English using the Google Translate API.<br><br>The Digital Dashboard is part of the Digital Ecosystem for E-Participation Linking Youth (DEEP-Linking Youth) co-funded by the Erasmus+ Programme of the European Union and implemented by a consortium of seven European organisations. The project aims to explore how e-participation can foster young peoples empowerment and active participation in democratic life.</div><div class="information"><b>Main project website</b><br><a href="http://deeplinkingyouth.eu/" target="_blank">http://deeplinkingyouth.eu/</a></div><div class="information"><b>The open source code behind this website</b><br><a href="https://github.com/rbjarnason/active-citizen-dashboard" target="_blank">https://github.com/rbjarnason/active-citizen-dashboard</a></div></div></div></section><ac-news-item-classification item-id="{{itemId}}" name="classify"></ac-news-item-classification><template is="dom-if" if="[[isAdmin]]" restamp=""><ac-view-items id="all" name="all" category="all"></ac-view-items><ac-view-items id="finance" name="finance" category="Finance"></ac-view-items><ac-view-items id="housing" name="housing" category="Housing"></ac-view-items><ac-view-items id="university" name="university" category="University"></ac-view-items><ac-view-items id="other" name="other" category="Other"></ac-view-items><ac-view-items id="predictedNotRelevant" name="predictedNotRelevant" predicted-not-relevant=""></ac-view-items></template></iron-pages></app-header-layout><paper-toast id="toast1" duration="0" text="Please help us to improve this non-profit experimental dashboard by answering a few questions."><paper-button on-tap="_closeToast" class="yellow-button">Close</paper-button><paper-button on-tap="_showToastLater" class="yellow-button">Later</paper-button><a href="https://w
